//////////////////////////////////////////////////////////////////////
// Purpose: Category Page Component
// Author: Siddharth Karanchery
//////////////////////////////////////////////////////////////////////

import React, { useEffect, useState } from "react";

import { useNavigate } from "react-router-dom";

import {
  Button,
  Card,
  CardBody,
  CardFooter,
  Col,
  Container,
  Form,
  Input,
  InputGroup,
  Textarea,
  InputGroupAddon,
  InputGroupText,
  Row,
} from "reactstrap";

import "./ContactUs.css";

function ContactUs(props) {
  const [mail, setMail] = useState({
    Name: "",
    Email: "",
    Subject: "",
    Message: "",
  });
  const navigate = useNavigate();

  const onChangeHandler = (e) => {
    e.persist();

    setMail({ ...mail, [e.target.name]: e.target.value });
  };

  const onSubmitHandler = (e) => {
    e.preventDefault();

    const data = {
      Name: mail.Name,
      Email: mail.Email,
      Password: mail.Subject,
      Message: mail.Message,
    };

    console.log("Data:", data);
  };

  return (
    <div className="ContactUs">
      <div className="ContactUs__card">
        <div className="ContactUs__card__ele" id="card__ele">
          <h3>Contact Us</h3>
          <img
            className="ContactUs__card__ele__img"
            src="https://img.freepik.com/free-vector/users-with-speech-bubbles-vector_53876-82250.jpg?size=626&ext=jpg"
            alt=""
          />
        </div>
        <div className="ContactUs__card__ele" id="card__ele1">
          <Container>
            <Row className="justify-content-center">
              <Col fluid="true">
                <Card className="mx-4">
                  <CardBody className="p-4">
                    <Form onSubmit={onSubmitHandler}>
                      <h1>Register</h1>

                      <InputGroup className="mb-3">
                        <Input
                          type="text"
                          name="Name"
                          id="Name"
                          placeholder="Name"
                          value={mail.Name}
                          onChange={onChangeHandler}
                        />
                      </InputGroup>

                      <InputGroup className="mb-3">
                        <Input
                          type="email"
                          placeholder="Email"
                          name="Email"
                          id="Email"
                          value={mail.Email}
                          onChange={onChangeHandler}
                        />
                      </InputGroup>

                      <InputGroup className="mb-3">
                        <Input
                          type="text"
                          placeholder="Subject"
                          name="Subject"
                          id="Subject"
                          value={mail.Subject}
                          onChange={onChangeHandler}
                        />
                      </InputGroup>

                      <InputGroup className="mb-4">
                        <Input
                          type="textarea"
                          placeholder="Message"
                          name="ConfirmPass"
                          id="ConfirmPass"
                          value={mail.ConfirmPass}
                          onChange={onChangeHandler}
                        />
                      </InputGroup>

                      <CardFooter className="p-4">
                        <Row>
                          {/* <Col xs="12" sm="6"> */}
                          <Button
                            type="submit"
                            className="btn btn-success mb-1"
                            block
                          >
                            <span>Send</span>
                          </Button>
                          {/* </Col> */}

                          {/* <Col xs="12" sm="6">
                            <Button
                              className="btn btn-light mb-1"
                              block
                              onClick={() => {
                                navigate("/Home");
                              }}
                            >
                              <span>Cancel</span>
                            </Button>
                          </Col> */}
                        </Row>
                      </CardFooter>
                    </Form>
                  </CardBody>
                </Card>
              </Col>
            </Row>
          </Container>
        </div>
      </div>
    </div>
  );
}
export default ContactUs;
